import React, { Component } from 'react'

export class ColorsComponent extends Component {
  render() {
    return (
      <div>
        <div style={mainColorDiv}>
            <div></div>
            <p>DiffrentColor</p>
        </div>
      </div>
    )
  }
}
const mainColorDiv ={
    width:'20%',
    height:'20%',
    border:'1px solid black'

}

export default ColorsComponent
